let pdfExport = {
    run: () => {
        pdfExport.settings();
        pdfExport.bindEvents();
    },
    settings: () => {
        let id = $("#tour_date_id").data('tour-id');
        // pdfExport.tourId = document.getElementById('tour_date_id').dataset.tour-id;
        pdfExport.tourId = id;
        pdfExport.companyText = "EETS EUROPE EXPRESS & EAST EUROPE TRAVEL SERVICE INT'L CO., LTD\n" +
            "( Associates ) / Budapest operation office:\n" +
            "RADAY utca 15. 1/14, Budapest 1092 , Hungary\n" +
            "TEL: +36 1 2019416 / 2019422 , FAX: +36 1 2019418\n" +
            "Office Email : eets@eets.hu";
        pdfExport.coord = {
            left: 45,
            top: 112,
            line: 155,
            diff: 15
        };
        pdfExport.tourCode = '';
    },
    bindEvents: () => {
        document.getElementById('pdfButton').addEventListener('click', (e) => {
            e.preventDefault();
            pdfExport.getPackage(pdfExport.tourId, short = false);
        });
        document.getElementById('pdfShortButton').addEventListener('click', (e) => {
            e.preventDefault();
            pdfExport.getPackage(pdfExport.tourId, short = true);
        })
    },
    prepareTourTable: () => {
        pdfExport.tourTable = {
            columns: ['Issued Date', new Date(Date.now()).toLocaleString()],
            rows: []
        };
    },
    parseTourTable: () => {
        let startingTable = document.getElementById('pdf-table');
        for(let i = 1, row; row = startingTable.rows[i]; i++){
            let col = [];
            for (let j = 0, cell; cell = row.cells[j]; j++){
                col.push(cell.innerText);
            }
            pdfExport.tourTable.rows.push(col);
        }
    },
    prepareServiceTable: (doc, coord, rowsLength) => {
        for (let i = 0; i <= rowsLength; i++){
            let left = coord.left+coord.line;
            let lineLength = 350 / 3;
            if (i === 0 || i > 2) { doc.rect(left, coord.top, 350, coord.diff); }
            if (i === 1) { coord.diff = 25; }
            if (i === 2) { coord.diff = 45; }
            if (i === 1 || i === 2) {
                doc.rect(left, coord.top, lineLength, coord.diff);
                doc.rect(left+lineLength, coord.top, lineLength, coord.diff);
                doc.rect(left+lineLength*2, coord.top, lineLength, coord.diff);
            }
            if (i === 3) { coord.diff = 15; }
            doc.rect(coord.left, coord.top, coord.line, coord.diff);
            coord.top += coord.diff;
        }
    },
    checkServiceField: (service) => {
        for(let data in service){
            if (service[data] === null || typeof service[data] === undefined) service[data] = '';
            if(service[data].length > 10) service[data] = service[data].substring(0, 18);
        }
    },
    fillService: (doc, service, coord) => {
        let left = coord.left + coord.line + 3;
        let lineLength = 350 / 3;
        let top = coord.top+12;
        let lt = coord.left + 5;
        pdfExport.checkServiceField(service);
        doc.text('Booking:', lt, top);
        doc.text(service.assigned_user, left, top);
        doc.text('Tour Code:', lt, top += 20);
        pdfExport.checkServiceField(pdfExport);
        doc.text(pdfExport.tourCode, left, top);
        doc.text('Reference:', left+lineLength, top);
        doc.text('What must be here?', left+lineLength*2, top);
        doc.text('Service Type:', lt, top += 20);
        doc.text(service.type, left, top);
        doc.text('Service Date:', left+lineLength, top);
        let from = moment(service.time_from).format('D.MM.Y HH:mm');
        let to = moment(service.time_to).format('D.MM.Y HH:mm');
        doc.text('From: ' + from, left+lineLength*2, top);
        doc.text('To: ' + to, left+lineLength*2, top += 20);
        doc.text('Pax:', lt, top += 22);
        doc.text('' + service.pax, left, top);
        if (service.type === 'hotel') {
            doc.text('Rooms:', coord.left, top += coord.diff);
            service.rooms = (service.rooms === undefined) ? '' : service.rooms;
            doc.text('' + service.rooms, left, top);
        }
        doc.text('Porterage:', lt, top += coord.diff);
        doc.text('what must be here ?', left, top);
        doc.text('Detail:', lt, top += coord.diff);
        doc.text('' + service.note, left, top);
        doc.text('Payment Detail', lt, top += coord.diff);
        doc.text('what must be here ?', left, top);
    },
    fillHeader: (doc) => {
        let imgData = 'data:image/jpeg;base64,';
        doc.addImage(imgData, 'JPG', 45, 10, 150, 50);
        doc.setFontType('bold');
        doc.text(pdfExport.companyText, 200, 15);
        doc.line(45,65,550,65); // underscore for company text
        doc.setFont('helvetica');
        doc.setFontType('normal');
        // doc.text("To:", 45, 95);
        // doc.text(current.name, 225, 95);
        // doc.line(45, 112, 550, 112); // underscore for second line information
        // doc.text('Issued Date: ' + now, 350, 95);
        // doc.text('Issued By: ' + current.issued_by, 350, 110);
    },
    pdfGenerate: (data, id) => {
        let now = moment().format("D.MM.Y");
        let doc = new jsPDF('p', 'pt');
        doc.setFontSize(10);
        let page = 0;
        for(let day in data){
            for(let service in data[day].packages){
                let coord = Object.assign({}, pdfExport.coord);
                let current = data[day].packages[service];
                let tableLength = (current.type === 'hotel') ? 7 : 6;
                if (page > 0) { doc.addPage(); }
                pdfExport.fillHeader(doc);
                doc.text("To:", 45, 90);
                pdfExport.checkServiceField(current);
                if(current.name.length > 10) current.name = current.name.substring(0, 18);
                doc.text(current.name, 225, 90);
                doc.line(45, 112, 550, 112); // underscore for second line information
                doc.text('Issued Date: ' + now, 350, 90);
                doc.text('Issued By: ' + current.issued_by, 350, 105);
                pdfExport.fillService(doc, current, coord);
                pdfExport.prepareServiceTable(doc, coord, tableLength);
                page++;
            }
        }
        doc.save("tour_" + id + "_" + now + ".pdf");
    },
    generateVoucher: (data, id) => {
        let now = moment().format('D.MM.Y');
        let doc = new jsPDF('p', 'pt');
        doc.setFontSize(10);
        pdfExport.fillHeader(doc);
        pdfExport.voucherTable(data, doc);
        doc.save("tour_" + id + "_" + now + ".pdf");
    },
    voucherTable: (data, doc) => {
        let coord = Object.assign({}, pdfExport.coord);
        let top = coord.top;
        let left = coord.left;
        let tour = data.tour;
        let tourDates = data.tourDates;
        doc.setFontSize(16);
        doc.setFontType('bold');
        doc.text('Itinerary', left, top);
        doc.setFontSize(10);
        doc.setFontType('normal');
        doc.text('Name:', left, top += 25);
        if(tour.tourCode.length > 10) tour.tourCode = tour.tourCode.substring(0, 18);
        doc.text(tour.tourCode, left + coord.line, top);
        doc.text('Overview:', left * 3 + coord.line, top);
        doc.text('' + tour.overview, left * 5 + coord.line, top);
        doc.text('DepDate:', left, top += 12);
        doc.text('' + tour.departure_date, left + coord.line, top);
        doc.text('Pax', left * 3 + coord.line, top);
        doc.text('' + tour.pax, left * 5 + coord.line, top);
        doc.text('RetDate:', left, top += 12);
        doc.text('' + tour.retirement_date, left + coord.line, top);
        doc.text('Status:', left, top += 12);
        doc.text('' + tour.status, left + coord.line, top);
        top -= 10;
        let i = 0;
        for(let day in tourDates){
            let currentDay = tourDates[day];
            let date = moment(currentDay.date).format('MMMM D, YYYY (dddd)');
            doc.setFillColor(220,220,220);
            doc.rect(left, top += coord.diff, 500, coord.diff, 'F');
            doc.text('Day ' + i + ' #' + date, left, top + 10);
            // console.log(currentDay);
            let serviceTop = top;
            let serviceDiff = coord.diff;
            for(let service in currentDay.packages){
                let current = currentDay.packages[service];
                // doc.rect(left, top += coord.diff, 70, coord.diff);
                // doc.rect(left, serviceTop += serviceDiff, 70, serviceDiff + 20);
                pdfExport.checkServiceField(current);
                let timeFrom = moment(current.time_from).format('HH:mm');
                doc.rect(left, top + 15, 50, 35);
                doc.text(timeFrom, left + 10, top + coord.diff + 13);

                doc.rect(left + 50, top + 15, 250, 35);
                doc.text(current.type, left + 140, top + coord.diff + 10);
                doc.text('Name: ' + current.name, left + 100, top + coord.diff + 20);
                doc.text('Status: ' + current.status, left + 115, top + coord.diff + 30);

                doc.rect(left + 300, top + 15, 200, 35);
                doc.text('Pax: ' + current.pax, left + 375, top + coord.diff + 10);
                doc.text('' + current.note, left + 303, top + coord.diff + 20);
                top += 35;
                console.log(current);
            }
            i++;
        }
    },
    getPackage: (id, short) => {
        $.ajax({
            method: 'get',
            url: '/tour/' + id + '/pdf_data',
            success: (data) => {
                let res = $.parseJSON(data);
                pdfExport.tourCode = res.tour.tourCode;
                if (short) pdfExport.pdfGenerate(res.tourDates, id); else pdfExport.generateVoucher(res, id);
                // console.log(res);
            }
        })
    }
};
pdfExport.run();